Here's a JavaScript implementation for packing and unpacking an array of entities into an ArrayBuffer. The entities have the fields `id` (4 bits) and `size` (3 bits).

```javascript
function packEntities(entities) {
  const buffer = new ArrayBuffer(entities.length);
  const view = new DataView(buffer);

  for (let i = 0; i < entities.length; i++) {
    const entity = entities[i];
    const id = entity.id;
    const size = entity.size;

    // Pack id (4 bits)
    view.setUint8(i * 2, id >> 4);
    view.setUint8(i * 2 + 1, id & 0xF);

    // Pack size (3 bits)
    view.setUint8(i * 2 + 2, size >> 5);
    view.setUint8(i * 2 + 3, (size & 0x1F) << 3);
  }

  return buffer;
}

function unpackEntities(buffer, length) {
  const entities = [];
  const view = new DataView(buffer);

  for (let i = 0; i < length; i += 4) {
    const id = view.getUint8(i) << 4 | view.getUint8(i + 1);
    const size = view.getUint8(i + 2) >> 3 | view.getUint8(i + 3) << 5;

    entities.push({ id, size });
  }

  return entities;
}
```

In the `packEntities` function, we create an ArrayBuffer with the specified length and a DataView to access the buffer. We iterate through the entities and pack their id and size into the buffer.

In the `unpackEntities` function, we create a DataView for the given buffer and iterate through the buffer in chunks of 4 bytes (32 bits). We unpack the id and size from the buffer and create an entity object for each one.

You can use these functions like this:

```javascript
const entities = [
  { id: 0b0001, size: 0b101 },
  { id: 0b0010, size: 0b110 },
  // ...
];

const buffer = packEntities(entities);
// ...
const unpackedEntities = unpackEntities(buffer, entities.length);
```

